function formatName(user) {
  return  user.name + ' ' + user.last;
};

const user = {
  name: "anwar",
  last: "chennife",
  age: 29,
  avatarUrl: 'https://b.thumbs.redditmedia.com/7BBF5u_aOIeVPYLKLoZjvST_uyhnQNyHuwQ7PrXusHs.png'
};

const element = (
  <>
  <h1>Helle, {formatName(user)}</h1>
  <img src = {user.avatarUrl} alt="image"/>"  
  </>

);

const App = () => {
  return (
    <div className="App">
      {element}
    </div>

  );
}

export default App;
